svg.script:
var isEdit = "false";
var initData = new Map();
var no = "";
var svg1 = SVG("main");
var svg1Group = svg1.group();
var nodeList = svg1Group.node.childNodes;

//单击时生成图形
function svgClick(evt){
  isEdit = document.getElementById('main').getAttribute("isEdit");
  var initList = document.getElementById('main').getAttribute("initData");
  no = document.getElementById('main').getAttribute("no");
  if(initList){
    var kv1 = initList.split(";");
    for(var i in kv1){
      var kv2 = kv1[i].split(":");
      if(kv2.length == 2) initData.set(kv2[0],kv2[1]);
    }
  }
  if(isEdit == "false"){
    return;
  }
  if(isEdit == "true"){
    if(initData){
      if(initData.get(no)){

        return;
      }
    }

    var rect = svg1.rect(100,30);
    rect.attr("style", "stroke-width:1;stroke:rgb(0,0,0);fill:orange;fill-opacity:0.5;stroke:gray;" );
    rect.attr( "x",evt.offsetX);
    rect.attr( "y",evt.offsetY);
    rect.attr( "name",no);
    rect.attr( "text",no);
    rect.attr( "ondblclick","rectDblClicked(evt)");















    initData.set(no,""+(evt.offsetX)+","+evt.offsetY);


  }
}

//双击编辑
function rectDblClicked(evt){
  if(evt.target.instance.attr("onselect") == "true"){
    evt.target.instance.selectize(false);
    evt.target.instance.draggable(false);;
    evt.target.instance.attr("onselect","false");
  }else{
    evt.target.instance.draggable();
    evt.target.instance.selectize().resize();

    evt.target.instance.attr("onselect","true");
    evt.target.instance.attr("onblur","rectBlur(evt)");
  }
}

function rectBlur(evt){
  evt.target.selectize(false);
  evt.target.setAttribute("onselect","false");
}


function svgOnLoad(){
  initData.forEach(function (value, key, map) {
    var point = value.split(",");
    var rect = svg1.rect(point[2],point[3]);
    rect.attr("style", "fill:"+point[4]+";stroke-width:1;stroke:rgb(0,0,0);fill-opacity:0.5;stroke:gray;" );
    rect.attr( "x",point[0]);
    rect.attr( "y",point[1]);
    rect.attr("name",key);
    rect.draggable();
    rect.selectize().resize();
    rect.attr( "ondblclick",rectDblClicked(MouseEvent));
  });
}
